import React from 'react';

import backgroundOfHomePage from '../../icons/backgroundOfHomePage.jpg';

import './Image.css';

const Image = () => {
    return (
        <img src={backgroundOfHomePage} className='image' alt='A background image'/>
    );
};

export default Image;
